import './navbar.css';

function NavBar() {
  return (
    <div>
        <nav>
        <div class="boox">
            <a href="./Inicio.html" class="item">Pagina inicio</a>
            <a href="./Views/Profesor.html" class="item">Profesores</a>
            <a href="./Views/Materias.html" class="item">Materias</a>
            <a href="./Views/Horario.html" class="item">Horario</a>
            <a href="./Views/Repositorio.html" class="item">Repositorio</a> 
        </div>  

            <img src="data:image/png;base64,"/>
        </nav>
    </div>
  );
}

export default NavBar;
